import React, { Component } from 'react'

class Message extends Component {
    constructor(props) {
        super(props)

        this.state = {
             text: 'Welcome Visitor'
        }
    }

    render() {
        return (
            <div>
               {this.state.text}
            </div>
        )
    }
}

export default Message
